/* eslint-disable jsx-a11y/alt-text */
import React from "react"
import "./Index.css"
import Foto from "./Images/jefferson_lobato.png"


export default function Sobre(){

  return(

    <section className='sobre'>
        <div className='bloco-imagem-sobre'>
            <img className='imagem-sobre' src={Foto}/>
        </div>

        <article className='bloco-texto-sobre'>
            <p>Texto</p>
        </article>

    </section>

  )
}
